// בקובץ NavBar.jsx

import React from "react";
import { Link } from "react-router-dom";

function NavBar() {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/signIn">דף הבית</Link>
        </li>
        <li>
          <Link to="/">אודות</Link>
        </li>
        <li>
          <Link to="/">צור קשר</Link>
        </li>
      </ul>
    </nav>
  );
}

export default NavBar;
